import React from 'react';

const Contact = () => {
    return (
        <div>
            <Header />
            <h1>Contact Us</h1>
            <p>Vignan's Foundation for Science, Technology & Research</p>
            <p>Vadlamudi, Guntur - 522 213</p>
            <p>Andhra Pradesh, India</p>
            <p>Phone: +91-863-2344 700 / 701</p>
            <p>Email: info@vignan.ac.in</p>
        </div>
    );
};

export default Contact;
